import React, { useEffect, useState } from 'react';

function CumulativeResultsPage() {
  const [scores, setScores] = useState({});

  useEffect(() => {
    fetch('http://localhost:4000/api/cumulative-scores')
      .then(res => res.json())
      .then(data => {
        const sorted = Object.entries(data).sort((a, b) => b[1] - a[1]);
        const sortedScores = Object.fromEntries(sorted);
        setScores(sortedScores);
      });
  }, []);

  return (
    <div style={{ padding: '20px' }}>
      <h2>üèÜ Cumulative Scores</h2>
      <table>
        <thead>
          <tr>
            <th>#</th>
            <th>Player</th>
            <th>Total Score</th>
          </tr>
        </thead>
        <tbody>
          {Object.entries(scores).map(([player, score], index) => (
            <tr key={player}>
              <td>{index + 1}</td>
              <td>{player}</td>
              <td>{score}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default CumulativeResultsPage;
